import React, { Component } from "react";
import NavBar from "./components/navbar/NavBar";
import Items from "./components/items/Items";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <Items />
      </React.Fragment>
    );
  }
}

export default App;
